import React from 'react';
import { MDBProgress } from 'mdbreact';
import '../App.css';

const Progressbar = (props) => {
  return (
    <React.Fragment>
      <MDBProgress material striped value={75} animated color="default">
        <div style={{color:"black"}}>Your goal</div>
      </MDBProgress>
    </React.Fragment>
  );
};

export default Progressbar;


